INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24001, 401, "2030/12/17 14:59:59", 2, "アヤネ", "2020/07/31 12:00:00", 24, 102301, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 0.0, 10046, 0.0, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24002, 402, "2030/12/17 14:59:59", 2, "アヤネ", "2020/07/31 12:00:00", 24, 102301, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 1, 0.0, 10046, 0.0, 2.21);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24003, 403, "2030/12/17 14:59:59", 2, "アヤネ", "2020/07/31 12:00:00", 24, 102301, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 0.0, 10046, 0.0, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24004, 701, "2030/12/17 14:59:59", 1, "アサヒ", "2020/07/31 12:00:00", 24, 192201, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 2, 0.0, 10046, 0.0, 1.99);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24005, 702, "2030/12/17 14:59:59", 2, "アサヒ", "2020/07/31 12:00:00", 24, 192201, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 1, 0.0, 10046, 0.0, 2.21);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24006, 703, "2030/12/17 14:59:59", 1, "アサヒ", "2020/07/31 12:00:00", 24, 192201, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 2, 0.0, 10046, 0.0, 3.33);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24007, 801, "2030/12/17 14:59:59", 2, "部員３", "2020/07/31 12:00:00", 24, 192301, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 0.0, 10046, 0.0, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24008, 802, "2030/12/17 14:59:59", 2, "部員３", "2020/07/31 12:00:00", 24, 192301, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 1, 0.0, 10046, 0.0, 2.68);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24009, 803, "2030/12/17 14:59:59", 2, "部員３", "2020/07/31 12:00:00", 24, 192301, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 0.0, 10046, 0.0, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24010, 501, "2030/12/17 14:59:59", 1, "", "2020/07/31 12:00:00", 24, 192501, "やった！", 1, 0.0, 10046, 0.0, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24011, 502, "2030/12/17 14:59:59", 1, "", "2020/07/31 12:00:00", 24, 192501, "勝ったよ！", 1, 0.0, 10046, 0.0, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24012, 503, "2030/12/17 14:59:59", 1, "", "2020/07/31 12:00:00", 24, 192501, "いい調子！", 1, 0.0, 10046, 0.0, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24013, 111, "2030/12/17 14:59:59", 2, "ミサト", "2020/07/31 12:00:00", 24, 113501, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 6, 0.0, 10046, 0.0, 5.33);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24014, 112, "2030/12/17 14:59:59", 2, "ミサト", "2020/07/31 12:00:00", 24, 113501, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 1, 0.0, 10046, 0.0, 6.85);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24015, 113, "2030/12/17 14:59:59", 2, "ミサト", "2020/07/31 12:00:00", 24, 113501, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 1, 0.0, 10046, 0.0, 3.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24016, 611, "2030/12/17 14:59:59", 2, "ダイチ", "2020/07/31 12:00:00", 24, 192401, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 1, 0.0, 10046, 0.0, 6.11);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24017, 612, "2030/12/17 14:59:59", 2, "ダイチ", "2020/07/31 12:00:00", 24, 192401, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 1, 0.0, 10046, 0.0, 6.75);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24018, 613, "2030/12/17 14:59:59", 2, "ダイチ", "2020/07/31 12:00:00", 24, 192401, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 0.0, 10046, 0.0, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24019, 211, "2030/12/17 14:59:59", 1, "ハツネ", "2020/07/31 12:00:00", 24, 113401, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 2, 0.0, 10046, 0.0, 4.52);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24020, 212, "2030/12/17 14:59:59", 1, "ハツネ", "2020/07/31 12:00:00", 24, 113401, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 2, 0.0, 10046, 0.0, 3.89);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24021, 213, "2030/12/17 14:59:59", 2, "ハツネ", "2020/07/31 12:00:00", 24, 113401, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 1, 0.0, 10046, 0.0, 13.49);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24022, 311, "2030/12/17 14:59:59", 2, "カヤ", "2020/07/31 12:00:00", 24, 106501, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 1, 0.0, 10046, 0.0, 3.17);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24023, 312, "2030/12/17 14:59:59", 2, "カヤ", "2020/07/31 12:00:00", 24, 106501, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 1, 0.0, 10046, 0.0, 4.42);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24024, 313, "2030/12/17 14:59:59", 1, "カヤ", "2020/07/31 12:00:00", 24, 106501, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 6, 0.0, 10046, 0.0, 2.89);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24025, 421, "2030/12/17 14:59:59", 3, "アヤネ", "2020/07/31 12:00:00", 24, 102301, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 4, 0.0, 10046, 0.0, 3.71);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24026, 721, "2030/12/17 14:59:59", 1, "アサヒ", "2020/07/31 12:00:00", 24, 192201, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 2, 0.0, 10046, 0.0, 5.1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24027, 821, "2030/12/17 14:59:59", 3, "部員３", "2020/07/31 12:00:00", 24, 192301, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 1, 0.0, 10046, 0.0, 4.34);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24028, 521, "2030/12/17 14:59:59", 1, "", "2020/07/31 12:00:00", 24, 192501, "いい勝負だったよ\nまたやろうね", 1, 0.0, 10046, 0.0, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24029, 101, "2030/12/17 14:59:59", 2, "ミサト", "2020/07/31 12:00:00", 24, 113501, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 1, -360.0, 10046, 0.0, 5.62);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24030, 102, "2030/12/17 14:59:59", 2, "ミサト", "2020/07/31 12:00:00", 24, 113501, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 1, -360.0, 10046, 0.0, 9.58);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24031, 103, "2030/12/17 14:59:59", 2, "ミサト", "2020/07/31 12:00:00", 24, 113501, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, -360.0, 10046, 0.0, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24032, 104, "2030/12/17 14:59:59", 1, "ミサト", "2020/07/31 12:00:00", 24, 113501, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 2, -360.0, 10046, 0.0, 9.13);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (24033, 105, "2030/12/17 14:59:59", 2, "ミサト", "2020/07/31 12:00:00", 24, 113501, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 1, -360.0, 10046, 0.0, 8.27);
